import React, { useState } from 'react';

const foodItems = {
    // Main Course - Rice Items
    '101': { name: 'Veg Biryani', rate: 180 },
    '102': { name: 'Chicken Biryani', rate: 220 },
    '103': { name: 'Mutton Biryani', rate: 280 },
    '104': { name: 'Plain Rice', rate: 80 },
    '105': { name: 'Jeera Rice', rate: 120 },
    '106': { name: 'Pulao', rate: 150 },

    // Rotis & Breads
    '201': { name: 'Chapati', rate: 15 },
    '202': { name: 'Bhakri', rate: 20 },
    '203': { name: 'Naan', rate: 35 },
    '204': { name: 'Butter Naan', rate: 45 },
    '205': { name: 'Puran Poli', rate: 60 },

    // Maharashtrian Specialties
    '301': { name: 'Vada Pav', rate: 25 },
    '302': { name: 'Misal Pav', rate: 80 },
    '303': { name: 'Pav Bhaji', rate: 90 },
    '304': { name: 'Bhel Puri', rate: 40 },
    '305': { name: 'Sev Puri', rate: 50 },
    '306': { name: 'Dahi Puri', rate: 60 },
    '307': { name: 'Poha', rate: 45 },
    '308': { name: 'Upma', rate: 40 },
    '309': { name: 'Sabudana Khichdi', rate: 70 },
    '310': { name: 'Thalipeeth', rate: 65 },

    // Curry & Sabji
    '401': { name: 'Dal Tadka', rate: 110 },
    '402': { name: 'Dal Fry', rate: 100 },
    '403': { name: 'Amti (Maharashtrian Dal)', rate: 120 },
    '404': { name: 'Bhendi Fry', rate: 140 },
    '405': { name: 'Aloo Gobi', rate: 130 },
    '406': { name: 'Palak Paneer', rate: 160 },
    '407': { name: 'Paneer Butter Masala', rate: 180 },
    '408': { name: 'Chicken Curry', rate: 200 },
    '409': { name: 'Mutton Curry', rate: 250 },
    '410': { name: 'Fish Curry (Koliwada)', rate: 220 },

    // Drinks & Beverages
    '501': { name: 'Sol Kadhi', rate: 40 },
    '502': { name: 'Buttermilk (Taak)', rate: 30 },
    '503': { name: 'Sugarcane Juice', rate: 35 },
    '504': { name: 'Tea', rate: 15 },
    '505': { name: 'Coffee', rate: 20 },
    '506': { name: 'Masala Tea', rate: 20 },
    '507': { name: 'Cold Drink', rate: 25 },
    '508': { name: 'Fresh Lime Water', rate: 30 },

    // Sweets & Desserts
    '601': { name: 'Modak', rate: 50 },
    '602': { name: 'Puran Poli', rate: 60 },
    '603': { name: 'Shrikhand', rate: 80 },
    '604': { name: 'Basundi', rate: 70 },
    '605': { name: 'Gulab Jamun', rate: 60 },
    '606': { name: 'Rasgulla', rate: 50 },
};

const FoodEntry = ({ onFoodSelect }) => {
    const [foodCode, setFoodCode] = useState('');
    const [quantity, setQuantity] = useState(1);
    const [error, setError] = useState('');

    const handleFoodCodeChange = (e) => {
        setFoodCode(e.target.value);
        setError('');
    };

    const handleQuantityChange = (e) => {
        setQuantity(e.target.value);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (foodItems[foodCode]) {
            const selectedFood = {
                code: foodCode,
                name: foodItems[foodCode].name,
                rate: foodItems[foodCode].rate,
                quantity: parseInt(quantity)
            };
            onFoodSelect(selectedFood);
            setFoodCode('');
            setQuantity(1);
        } else {
            setError('Invalid food code');
        }
    };

    return (
        <div>
            <h2>Food Entry</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>
                        Food Code:
                        <input type="text" value={foodCode} onChange={handleFoodCodeChange} />
                    </label>
                </div>
                <div>
                    <label>
                        Quantity:
                        <input type="number" value={quantity} onChange={handleQuantityChange} min="1" />
                    </label>
                </div>
                <button type="submit">Add Food</button>
                {error && <p style={{ color: 'red' }}>{error}</p>}
            </form>
        </div>
    );
};

export default FoodEntry;
